import "./App.css";
import Navigation from "./components/Navigation";
import React from "react";
import {
  BrowserRouter as Router,
  Redirect,
  Route,
  Switch,
} from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <Navigation />
        <Switch>
          <Route exact path="/" />
          <Route exact path="/pedidos" />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
